import React from "react";
import GridItem from "./GridItem";

import "./GridList.css"

const GridList = () => {
  return(
    <ul class="gridList">
      <GridItem image="/img/movie_1.jpg" altText="a new Hope"/>
      <GridItem image="/img/movie_2.jpg" altText="The Empire strikes back"/>
      <GridItem image="/img/movie_3.jpg" altText="Return of the Jedi"/>
      <GridItem image="/img/movie_4.jpg" altText="The Phantom Menace"/>
      <GridItem image="/img/movie_5.jpg" altText="Attack of the clones"/>
      <GridItem image="/img/movie_6.jpg" altText="Revenge of the Sith"/>
      <GridItem image="/img/movie_7.jpg" altText="The Force Awakens"/>
      <GridItem image="/img/movie_8.jpg" altText="The Last Jedi"/>
      <GridItem image="/img/movie_9.jpg" altText="The Rise of Skywalker"/>
    </ul>
  );
}

export default GridList;
